import React from 'react';
import { Link } from 'react-router-dom';
import './MovieList.css';

const movies = [
    { id: 1, title: 'Stree', image: 'https://m.media-amazon.com/images/M/MV5BMjk4NGZiMzAtODU1NS00MmQ4LWJiNmQtNWU5ZWU4Y2VmNWI0XkEyXkFqcGdeQXVyODE5NzE3OTE@._V1_.jpg' },
    { id: 2, title: 'Bhediya', image: 'data:image/jpeg;base64,' },
    { id: 3, title: 'Bhool Bhulaiyaa', image: 'data:image/jpeg;base64,' },
    { id: 4, title: 'Munjya', image: 'data:image/jpeg;base64,' },
    { id: 5, title: 'Chennai Express', image: 'data:image/jpeg;base64,' },
    { id: 6, title: 'Avengers Endgame', image: 'data:image/jpeg;base64,' },
];

const MovieList = () => {
  return (
    <div className="movie-list">
      {movies.map(movie => (
        <Link 
          to={`/movie/${movie.id}`} 
          key={movie.id} 
          state={{ movie }}
          className="movie-card"
        >
          <img src={movie.image} alt={movie.title} className="movie-image" />
          <h3>{movie.title}</h3>
        </Link>
      ))}
    </div>
  );
};

export default MovieList;
